    static void getDataStr(String string) {
        List<String[]> objects = new ArrayList<String[]>();
        objects.add(new String[]{"id_catalog_category", "(\\d+)"});
        objects.add(new String[]{"regional_key", "\\d+"});
        objects.add(new String[]{"name", "([^\\\"]+)"});
        objects.add(new String[]{"lft", "\\d+"});
        objects.add(new String[]{"rgt", "\\d+"});
        objects.add(new String[]{"url_key", "[^\\\"]+"});
        objects.add(new String[]{"fk_vertical", "[^\\\"]+"});
        objects.add(new String[]{"facets", "[^\\\"]+"});
        objects.add(new String[]{"is_virtual", "[^\\\"]+"});
        objects.add(new String[]{"use_custom_layout", "[^\\\"]+"});
        objects.add(new String[]{"theme", "[^\\\"]+"});
        objects.add(new String[]{"sub_menu_folder_key", "[^\\\"]*"});
        objects.add(new String[]{"segments", "[^\\,]*", String.valueOf(true)});
        objects.add(new String[]{"ios_url_icon", "[^\\\"]+"});
        objects.add(new String[]{"android_url_icons", "\\{[^\\{\\}]+}", String.valueOf(true)});
        objects.add(new String[]{"disable_sticky_header", "[^\\\"]+"});
        objects.add(new String[]{"children", "(\\[(\\s*\\{.*\\}\\s*,\\s*)+\\{.*\\}\\s*\\])", String.valueOf(true)});
        objects.add(new String[]{"product_count", "\\d+", String.valueOf(true)});
        objects.add(new String[]{"api_url", "[^\\\"]+"});
        objects.add(new String[]{"info_url", "[^\\\"]+"});

        String completeObject = compoundUrl(objects);

        String REGEXP = "(\\s*" + completeObject + "\\s*)+";
        System.out.println("REGEXP:" + REGEXP);
        Pattern pattern = Pattern.compile(REGEXP);
        Matcher matcher = pattern.matcher(string);

        while (matcher.find()) {
            for (int i = 1; i <= matcher.groupCount(); i++) {
                System.out.println("data:" + matcher.group(i));
            }
        }

    }

    static String compoundUrl(List<String[]> objects) {
        String result = "";
        String separate = "";

        for (String[] object : objects) {
            result += separate + compoundUrl(object);
            separate = "\\s*,\\s*";
        }
        return result;
    }


    static String compoundUrl(String[] object) {
        if (object.length == 2) {
            return compoundUrl(object[0], object[1]);
        }
        return compoundUrl(object[0], object[1], true);
    }

    static String compoundUrl(String key, String valueRegExp) {
        return compoundUrl(key, valueRegExp, false);
    }

    static String compoundUrl(String key, String valueRegExp, boolean isNested) {
        if (!isNested) {
            return key + ":\\s*" + "\"" + valueRegExp + "\"";
        }
        return key + ":\\s*" + valueRegExp;
    }

